import React from 'react';
import Home from './pages/Home';

function App() {

  const appStyle = {
    background: "linear-gradient(to bottom, #282c34 30%, #0398fc 150%)",
    overflow: 'scroll',
    height: '100vh',
    width: '100vw',
    overflow: 'auto'
  };

  //Above are CSS styles

  return (
    <>
      <div style={appStyle}>
        <Home />
      </div>
    </>
  );
}





export default App;
